<script setup>
import { onMounted } from "vue";
import { animate } from "motion";
const DURATION = 0.5;
const EASING_EASEIN_QUART = [0.22, 0.61, 0.36, 1];
const PARALLAX_STRENGTH = 15;

const $root = ref(null);
const $rectangle = ref(null);
const $circlesFront = ref(null);
const $circlesBack = ref(null);
const $leafRight = ref(null);
const $leafLeft = ref(null);
const $leafLeftShadowLeft = ref(null);
const $leafLeftShadowRight = ref(null);
const $twig1 = ref(null);
const $twig2 = ref(null);
const $dots = ref(null);

let isHovering = ref(false);

let shape = null;
let attemptedHover = false;
let isHoverable = false;
let mousePositionX = ref(0);
let mousePositionY = ref(0);
let mobileMode = true;

let latestEvent;
let currentAnimation;

const transition = {
  easing: "ease-out",
};

function springToMouse() {
  mousePositionX.value = latestEvent.clientX - shape.left;
  mousePositionY.value = latestEvent.clientY - shape.top;

  const movementX = ~~(
    ((mousePositionX.value - shape.width / 2) / (shape.width / 2)) *
    PARALLAX_STRENGTH
  );
  const movementY = ~~(
    ((mousePositionY.value - shape.height / 2) / (shape.height / 2)) *
    PARALLAX_STRENGTH
  );

  currentAnimation = animate(
    $rectangle.value,
    {
      x: movementX,
      // y: movementY,
    },
    transition
  );
  currentAnimation = animate(
    [$circlesFront.value, $circlesBack.value],
    {
      x: movementX * 2.3,
      y: movementY * 0.5,
    },
    transition
  );
  currentAnimation = animate(
    [$leafLeftShadowLeft.value, $leafLeftShadowRight.value, $leafLeft.value],
    {
      x: movementX * 1.3,
      // y: movementY * 0.1,
    },
    transition
  );

  currentAnimation = animate(
    $leafRight.value,
    {
      x: movementX * 3.6,
      // y: movementY * 0.4,
    },
    transition
  );
  currentAnimation = animate(
    $twig1.value,
    {
      x: movementX * 1.2,
      y: movementY * 1.7,
    },
    transition
  );
  currentAnimation = animate(
    [$dots.value, $twig2.value],
    {
      x: movementX * 1.6,
      y: movementY * 1.4,
      rotate: 2,
    },
    transition
  );
}

function handleMove(event) {
  event.preventDefault();
  latestEvent = event;
  if (isHoverable === true) {
    requestAnimationFrame(springToMouse);
  }
}

const handleEnter = () => {
  // console.debug("handleStart", mousePositionX.value, mousePositionY.value);
  attemptedHover = true;
  if (isHoverable) {
    isHovering.value = true;
  }
};
const handleLeave = () => {
  // console.debug("handleLeave", mousePositionX.value, mousePositionY.value);
  isHovering.value = false;
};

onBeforeMount(() => {
  if (window && window.innerWidth) {
    mobileMode = window.innerWidth < 768;
  }
});

onMounted(() => {
  shape = $root.value.getBoundingClientRect();

  $rectangle.value = $root.value.querySelector("#rectangle");
  $circlesFront.value = $root.value.querySelector("#plant-circles-front");
  $circlesBack.value = $root.value.querySelector("#plant-circles-back");
  $leafRight.value = $root.value.querySelector("#plant-leaf-right");
  $leafLeft.value = $root.value.querySelector("#plant-leaf-left");
  $leafLeftShadowLeft.value = $root.value.querySelector("#plant-shadow-left");
  $leafLeftShadowRight.value = $root.value.querySelector("#plant-shadow-right");
  $twig1.value = $root.value.querySelector("#twig1");
  $twig2.value = $root.value.querySelector("#twig2");
  $dots.value = $root.value.querySelector("#plant-dots");

  setTimeout(() => {
    // console.log(`isHoverable.`);
    isHoverable = true;

    if (attemptedHover) {
      handleEnter();
    }
  }, 1200);
});
</script>

